Question: On a protractor, ray $BA$ goes through the 85-degree mark and ray $BC$ goes through the 30-degree mark. What is the measure, in degrees, of angle $ABC$?

[asy]
draw((0,0)--(2,0)..(1,1)..(0,0)..cycle,linewidth(2));

draw((1,0)--1.4dir(30)+(1,0),Arrow);
draw((1,0)--1.3dir(85)+(1,0),Arrow);

dot(1.1dir(85)+(1,0));
dot(1.2dir(30)+(1,0));

label("A",1.1dir(85)+(1,0),NW);
label("B",(1,0),S);
label("C",1.2dir(30)+(1,0),SE);

label("85",.9dir(85)+(1,0));
label("30",.9dir(30)+(1,0));

[/asy]
Answer:

output:
We can draw the altitude from $A$ to $\overline{BC}$ as shown.

[asy]
draw((0,0)--(2,0)..(1,1)..(0,0)..cycle,linewidth(2));

draw((1,0)--1.4dir(30)+(1,0),Arrow);
draw((1,0)--1.3dir(85)+(1,0),Arrow);
draw((1,0)--(0,0)--(1.1dir(85)+(1,0)),dashed);
draw((1.1dir(85)+(1,0))--(1.1dir(110)+(1,0)));

dot(1.1dir(85)+(1,0));
dot(1.2dir(30)+(1,0));

label("A",1.1dir(85)+(1,0),NW);
label("B",(1,0),S);
label("C",1.2dir(30)+(1,0),SE);

label("85",.9dir(85)+(1,0));
label("30",.9dir(30)+(1,0));

[/asy]

Since $\angle ABC$ is a straight angle, we have $\angle ABD = 180^\circ - \angle ABC$.  Also, $\angle ABD = 90^\circ + \angle BAD$, so \[\angle ABC = 180^\circ - \angle ABC = 90^\circ - \angle BAD.\] By the Pythagorean Theorem, we have $BA^2 = AB^2 + BC^2$, so \[\cos \angle BAD = \frac{AB^2 + BC^2}{BA^2} = \frac{85^2 + 30^2}{85^2} = \frac{6225}{6485} = \frac{1245}{1297},\] and \[\sin \angle BAD = \sqrt{1 - \cos^2 \angle BAD} = \sqrt{\frac{242}{1297}} = \frac{2 \sqrt{61}}{1297^{1/2}}.\] Therefore, \[\angle ABC = 90^\circ - \angle BAD = 90^\circ - \arctan \frac{2 \sqrt{61}}{1297^{1/2}} = \boxed{89.99^\circ}.\] The answer is: 89.99^\circ

