The normal vector to the plane $x + 2y + 3z = 2$ is $\begin{pmatrix} 1 \\ 2 \\ 3 \end{pmatrix},$ and the normal vector to the plane $x - y + z = 3$ is $\begin{pmatrix} 1 \\ -1 \\ 1 \end{pmatrix}.$  These vectors are orthogonal, so their cross product will be the normal vector to the plane $P.$

[asy]
import three;

size(180);
currentprojection = perspective(6,3,2);

triple I = (1,0,0), J = (0,1,0), K = (0,0,1), O = (0,0,0);
triple A = (3,1,-1), B = (3,1,5), C = (0,0,3);

draw(surface((2*I + 3*J)--(2*I - 3*J)--(-2*I - 3*J)--(-2*I + 3*J)--cycle),paleyellow,nolight);
draw(surface((I + 2*J + 3*K)--(I - 2*J + 3*K)--(-I - 2*J + 3*K)--(-I + 2*J + 3*K)--cycle),palered,nolight);
draw(surface((I + J + K)--(-I - J + K)--(-I + J - K)--(I - J - K)--cycle),palecyan,nolight);
draw(A--B,dashed);
draw(A--C,dashed);
draw(O--B,Arrow3(6));
draw(O--C,Arrow3(6));
draw(O--A,Arrow3(6));

label("$x + 2y + 3z = 2$", (2*I + 3*J), N);
label("$x - y + z = 3$", (I - J) + (0,0,1), N);
label("$P$", B, N);
label("$L$", (B + C)/2, NE);
label("$(3,1,-1)$", A, S);
[/asy]

The normal vector to plane $P$ will be orthogonal to both of these vectors, so it will be proportional to the cross product
\[\begin{pmatrix} 1 \\ 2 \\ 3 \end{pmatrix} \times \begin{pmatrix} 1 \\ -1 \\ 1 \end{pmatrix} = \begin{pmatrix} 2 \\ 2 \\ -2 \end{pmatrix}.\]Scaling, we can take the normal vector to be $\begin{pmatrix} 1 \\ 1 \\ -1 \end{pmatrix}.$  Thus, the equation of plane $P$ is of the form
\[x + y - z + D = 0.\]Substituting the coordinates of $(3,1,-1),$ we find that the equation of plane $P$ is $\boxed{x + y - z + 3 = 0}.$ The answer is: x + y - z + 3 = 0

