Let $n$ be the number of t-shirts Sarah bought. Since the total cost was $\$67.94,$ we have \begin{align*}
15.22n + x &= 67.94 \\
\Rightarrow \qquad 15.22n &= 67.94 - x \\
\Rightarrow \qquad n &= \frac{67.94 - x}{15.22}
\end{align*}where $x$ is the cost of the sweatshirt. We want to minimize $n,$ so we want to maximize $x.$ Since $n$ must be an integer, the largest possible value of $x$ is $67.94 - 15.22 = \boxed{52.72}.$ The answer is: 52.72

