Let $F$ be the center of the base of the pyramid and $G$ be the midpoint of $\overline{AD}$. Since $\overline{PA}\perp\overline{AD}$, $PF=PG$. Since $\overline{PA}\perp\overline{AB}$, $PF^2+PG^2=PA^2$. We have $PF=PG=PA/2$, so $PA^2=4(PF^2+PG^2)=8PF^2$. Thus, $PF^2=PA^2/8=36/8=9/2$. Since $PF=PG$, we have $PG^2=9/2$, so $PG=3/2$.

The area of the base of the pyramid is $BC=4$. Thus, the volume of the pyramid is \[\frac{[ABCD]\cdot PA}{3}=\frac{BC\cdot PA}{3}=\frac{4\cdot 6}{3}=\boxed{8}.\] The answer is: 8

