We can simplify $\dbinom{n}{n}$ by using the identity $\dbinom{n}{k} = \dbinom{n-1}{k-1} + \dbinom{n-1}{k}$.  We have
\[\dbinom{n}{n} = \dbinom{n-1}{n-1} + \dbinom{n-1}{n} = \dbinom{n-1}{n-1} + \dbinom{n-1}{n-1} = 2\dbinom{n-1}{n-1} = 2^{n-1}.\]
Therefore, $\dbinom{n}{n} = \boxed{2^{n-1}}$. The answer is: 2^{n-1}

